{ "from": {  "category": "Company",   "name": "Radiorgasmic - arte & entretenimiento alternativo",   "id": "163668140488084" },  "privacy": {  "value": "" },  "actions": [  {   "link": "https://www.facebook.com/163668140488084/posts/267047896816774",    "name": "Comment"  },   {   "link": "https://www.facebook.com/163668140488084/posts/267047896816774",    "name": "Like"  } ],  "updated_time": "2014-06-18T12:38:36+0000",  "application": {  "name": "BlackBerry Smartphones App",   "id": "2254487659" },  "created_time": "2014-06-18T12:38:36+0000",  "message": "\u2020\u2020\u2020 \u2026 CARAVANA OFICIAL DE NAMNAMBULU EN LA OROYA \u2026 \u2020\u2020\u2020\n\nEstos son los precios oficiales para poder ir todos juntos a ver a NAMNAMBULU EN LA OROYA, tenemos dos paquetes que detallamos a continuaci\u00f3n:\n\nPAQUETE GENERAL: 01 pasaje (Lima-La Oroya-Lima) + 01 entrada GENERAL + 01 polo de NNB + 01 poster autografeado + pase libre a la conferencia de prensa = S/. 165\nPAQUETE VIP: 01 pasaje (Lima-La Oroya-Lima) + 01 entrada VIP + 01 polo de NNB + 01 poster autografeado + pase libre a la conferencia = S/. 190\nACEPTAMOS TARJETA VISA (pueden pagar hasta en 12 cuotas)\n\nPara mayor informaci\u00f3n escribir a namnambuluperu@gmail.com o al rpc 954107972 o visitar la tienda BITRONIC que queda en: Av. Bolivia 180 (esquina con la Av. Wilson) \u2013 cercado de lima\nRef: galer\u00edas WILSON PLAZA stand 240 (segundo piso)\n\nSomos la CARAVANA OFICIAL autorizada por la productora WiccamDark Eventos  y su festival www.facebook.com/oroyadreamsfestival y su auspiciador www.facebook.com/radior y su pagina oficial www.radiorgasmic.com",  "type": "status",  "id": "163668140488084_267047896816774",  "status_type": "mobile_status_update"}
